import {
    computed, makeAutoObservable
} from "mobx";
import {
    booksSearch
} from "../services/index.js";

class Mobx {
    booksData = {}

    constructor() {
        makeAutoObservable(this, {
            getBooksData: computed
        });
    }

    get getBooksData() {
        return this.booksData;
    }

    booksSearch = (data) => {
        let result
        booksSearch(data).then(event => {
            result = event.data;
        });
        console.log(result)
        return result;
    }
}

const MyMobx = new Mobx();
export default MyMobx;
